import React from 'react';
// import './form.styles.scss'
import { Group,FormInput,FormInputLable } from './form.style';

const FromInput=({handleChange,lable,...otherProps})=>{
    return(
    <Group>
        <FormInput onChange={handleChange} ex={otherProps.value.length}/>
       <FormInputLable>henok</FormInputLable>
       {
           
            lable? 
            (   
                <lable>
                  name
                </lable>
                
            ):
            null
        }
    </Group>)
}
export default FromInput;
